import React from 'react';
import './AdminPage.css';
import Sidebar from '../Dashboard/Sidebar';
import AdminSidebar from './AdminPageSidebar';
import { BrowserRouter as Router, Routes, Route} from 'react-router-dom';
import {
    FaTh,
    FaBars,
    FaDonate,
    FaHandsHelping,
    FaSignOutAlt,
    FaDatabase

}from "react-icons/fa";
const menuItem=[
  {
      path:"/Dashboard",
      name:"Dashboard",
      icon:<FaTh/>
  },
  {
      path:"/Dashboard/DonationData",
      name:"Donations Data",
      icon:<FaDatabase/>
  },
  {
      path:"/Dashboard/Items",
      name:"Items Donation",
      icon:<FaHandsHelping/>
  },
  {
      path: "/SignInSignUp",
      name: "LogOut",
      icon: <FaSignOutAlt/>
  }
]
function AdminPage() {
  return (
    <div>
        <Sidebar menuItem={menuItem}>
            <h1>Hi</h1>
        </Sidebar>
    </div>
  );
}

export default AdminPage;
